import React from "react";
import TodoList from "./TodoList";
import { Provider } from "react-redux";
import { createStore } from "redux";
import todoReducer from "./reducer";

const store = createStore(todoReducer);

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <TodoList />
      </div>
    </Provider>
  );
}

export default App;
